$(document).ready(function() { // ajax로 lastList 만들기
	$.ajax({
		url: "LastDam.do",
		type: "post",
		data: { num: 15 }, //없어도됨
		dataType: "json",
		success: function(res) {//call back함수, 응답값이 res로 자동으로 담김
			console.log('요청성공');
			console.log(res);
			var positions = [];
			for (var i = 0; i < res.length; i++) {
				var lastList = res;
				var content = [`<div class="overlaybox">
					<ul>
					<li class="up">
					<span class="number">` + nameList[i].dam_namekor + `</span>
					</li>
					<li>
					<span class="number">` + lastList[i].d_vow_rate + `</span>
					</li>
					<li>
					<span class="number">단계:`+checkDangerLevel(lastList[i].d_vow_rate)+`</span>
				</li>
				</ul>
				</div>`,nameList[i]];
				positions.push({
					content: content,
					latlng: new kakao.maps.LatLng(locxysplit[i][0],locxysplit[i][1])
				});
			};
			console.log(positions)
			for (var i = 0; i < res.length; i++) {
				imageSrc = checkDamColor(lastList[i].d_vow_rate);
				var imageSize = new kakao.maps.Size(35, 35);
				var markerImage = new kakao.maps.MarkerImage(imageSrc, imageSize);
				var marker = new kakao.maps.Marker({
					map: map, // 마커를 표시할 지도
					position: positions[i].latlng, // 마커의 위치
					image: markerImage,// 마커 이미지
					title: [nameList[i].dam_name,nameList[i].dam_namekor]  // 마커 이름
				});
				var infowindow = new kakao.maps.InfoWindow({
					content: positions[i].content[0] // 인포윈도우에 표시할 내용
					
				});
				kakao.maps.event.addListener(marker, 'mouseover', makeOverListener(map, marker, infowindow));
				kakao.maps.event.addListener(marker, 'mouseout', makeOutListener(infowindow));
				kakao.maps.event.addListener(marker, 'click',makeClickListener(marker));
				
			};

			function makeOverListener(map, marker, infowindow) {
				return function() {
					infowindow.open(map, marker);
				};
			};

			// 인포윈도우를 닫는 클로저를 만드는 함수입니다 
			function makeOutListener(infowindow) {
				return function() {
					infowindow.close();
				};
			};
			function makeClickListener(marker) {
				return function() {
					console.log(marker.getTitle());
					var markersplit=marker.getTitle().split(",");
					var uri="goWindow.do?dam_name="+markersplit[0]+"&dam_namekor="+markersplit[1];
					var res1=encodeURI(uri);
					window.open(res1,"상세정보조회","toolbar=no,location=no,resizeable=no,scrollbar=yes,status=no,location=no,menubar=no,width=700,height=600,top=200,left=700");
					console.log(res1);
				};
			};
		},
		// 3. 요청이 실패할때 실행할 함수 : 오류임!
		erro: function() {
			console.log('요청실패!');
		}
	})
});


